import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
    container: {
        paddingHorizontal : 20, 
        flex: 1, 
        backgroundColor: '#000'
    },
    jetSpeedWordContainter:{
        flexDirection: "row", 
        marginTop: 40
    },
    jetWord: {
        fontWeight: "bold", 
        fontSize: 22,
        color: '#fff'
    },
    speedWord :{
        fontWeight: "bold", 
        fontSize: 22,
        color: '#333'
    },
    welcomeWordContainer : {
        marginTop: 70
    },
    welcome:{
        fontSize: 27, 
        fontWeight: 'bold', 
        color: '#fff'
    },
    signContinue: {
        fontSize: 16, 
        fontWeight: 'bold', 
        color: '#333'
    },
    formContainer:{
        marginTop: 20
    },
    emailFieldContainer:{
        flexDirection: 'row', 
        marginTop: 20, 
        borderBottomWidth: 1, 
        borderBottomColor: '#f2f2f2', 
        paddingBottom: 5
    },
    emailIcon: {
        position: 'absolute', 
        color: '#fff'
    },
    emailField : {
        color: '#fff',  
        paddingLeft: 30,  
        flex: 1,  
        fontSize: 18
    }
});
